import "./App.css";
import { BrowserRouter, Route } from "react-router-dom";
import Landing from "./components/Landing";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" component={Landing} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
